<script type="text/javascript">

{

}
}
function toPoint(percent){
   		 	var str=percent.replace("%","");
    		        str= str/100;
					return str;
}
function toPercent(point){
			var percent = Number(point*100).toFixed(1);
			percent+="%";
			return percent;
}
function enlarge()
{
var height=toPoint(document.getElementById("mst").style.height);
if(height<5)
document.getElementById("mst").style.height=toPercent(height*1.1);
else
alert("It can't zoom in any more")
}
function narrow()
{
var height=toPoint(document.getElementById("mst").style.height);
if(height>0.3)
document.getElementById("mst").style.height=toPercent(height*0.9);
else
alert("It can't be reduced any more")
}
function reset()
{
document.getElementById("mst").style.height="100%";
}

</script>
